import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import NavBar from './components/NavBar.js';
import Portada from './components/Portada.js';
import QuienSoy from './components/QuienSoy.js';
import Skills from './components/Skills.js';
import Softwares from './components/CuadroSoftware.js';
import CuadroSoftwar from './components/CuadroSoftware.js';
import CrearSoluciones from './components/CrearSoluciones.js';
import UltimosProyectos from './components/UltimoProyecto.js';



function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <Switch>
          <Route path="/" exact component={Portada} />
          <Route path="/quien-soy" component={QuienSoy} />
          <Route path="/skills" component={Skills} />
          <Route path="/softwares" component={Softwares} />
          <Route path="/crear-soluciones" component={CrearSoluciones} />
          <Route path="/ultimos-proyectos" component={UltimosProyectos} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
